import * as taskApi from '../apis/tasks';

export const fetchTasks = () => {
    return (dispatch) => {
      return taskApi.fectchTasks()
      .then(data => {
        console.log(data)
      })
      .catch( err => {
        console.log(err);
      });
    }
 }
